import { useEffect } from "react";
import { Link } from "react-router-dom";

export default function Header() {
  useEffect
  return (
    <header>
      <Link to="/" className="logo">
        MyBlog
      </Link>
      <nav>
        <Link to="/login">Login</Link>
        <Link to="/register">Register</Link>
      </nav>
    </header>
  );
}
